elp.joomla.org/component/option,com_easyfaq/Itemid,268/\" target=\"_blank\">Frequently Asked Questions (FAQ)</a> area.  If you are stuck on a particular screen in the Administration area of Joomla! (which is where you are now), then try clicking on the Help toolbar button which you will find on almost all screens.  This will take you to a page about that screen on our <a href=\"http://help.joomla.org\" target=\"_blank\">Help Site</a>.  If you still have questions then take a look on our <a href=\"http://forum.joomla.org\" target=\"_blank\">forum</a> which is most likely the biggest resource on Joomla! there is and you will find almost every question answered at least once, so please try using the search function before asking your question.</p><p>Security is a big concern for us, which is why we would like you to subscribe to the <a href=\"http://forum.joomla.org/viewforum.php?f=8\" target=\"_blank\">announcement forum</a> (by clicking on the Notify button) to always get the latest information on new releases for Joomla! You should also read the <a href=\"http://help.joomla.org/component/option,com_easyfaq/task,view/id,167/Itemid,268/\" target=\"_blank\">Joomla! Administrator\'s Security Checklist</a> and regularly check the <a href=\"http://forum.joomla.org/viewforum.php?f=432\" target=\"_blank\">security forum</a>.</p><p>We hope you have much fun and success with Joomla! and hope to see you in the forum among the hundreds and thousands of contributors.</p><p>Your Joomla! team.<img alt=\"Smile\" border=\"0\" src=\"../plugins/editors/tinymce/jscripts/tiny_mce/plugins/emotions/images/smiley-smile.gif\" title=\"Smile\" /></p><p>P.S.: To remove this message, delete the &quot;Welcome to Joomla!&quot; Module in the Administrator screen of the Module Manager (on the Extensions menu).  Here is a <a href=\"index.php?option=com_modules&amp;client=1\">quick link</a> to this screen.</p></div>',1,'cpanel',0,'0000-00-00 00:00:00',1,'mod_custom',0,2,1,'moduleclass_sfx=\n\n',1,1,'');
